import React from 'react';
import './StarRating.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faStar, faStarO } from "@fortawesome/free-solid-svg-icons";

class StarRating extends React.Component {
    constructor() {
      super();

      this.state = {
        rating: 0
      };

    }

    render() {
        return(
            <div className="star-rating">
                <input type="radio" name="star" id="str5" value="5"/><label for="str5"><FontAwesomeIcon icon={faStar} size="md"/></label>
                <input type="radio" name="star" id="str4" value="4"/><label for="str4"></label>
                <input type="radio" name="star" id="str3" value="3"/><label for="str3"></label>
                <input type="radio" name="star" id="str2" value="2"/><label for="str2"></label>
                <input type="radio" name="star" id="str1" value="1"/><label for="str1"></label>
            </div>
        );
    }
}

export default StarRating;
